// SPDX-License-Identifier: LGPL-3.0+
pragma solidity >=0.5.0;

library ccGroth16BN128{

    // BN128 에서는 G1이 2개의 uint256로 구성되어 있고, G2는 4개의 uint256로 구성되어 있다.

    // VerifyingKey : 
    //      uint256[2] alpha    : G_1
    //      uint256[4] beta     : G_2
    //      uint256[4] delta    : G_2
    //      uint256[2] gamma_abc: G_1
    //      uint256[4] gamma    : G_2

    // Proof : 
    //      uint256[2] A    : G_1
    //      uint256[4] B    : G_2
    //      uint256[2] C    : G_1
    //      uint256[2] D    : G_1

    // Verification equation:
    //      A*B = alpha*beta + C*dela + D*gamma 
    //      A*B - alpha*beta - C*dela - D*gamma = 0
    // ccSNARK dose not have inputs, inputs are embeded at D

    function _verify(
        uint256[] storage vk,
        uint256[] memory proof
    )
        internal
        returns (bool)
    {
        require(proof.length == 10, "Invalid proof length");
        require(vk.length ==  16, "Invalid vk length");
        uint256 vk_slot_num;
        uint256[24] memory inputs;
        bool success;

        // inputs[0] = proof[8];
        // inputs[1] = proof[9];
        // inputs[2] = vk[10];
        // inputs[3] = vk[11];
        assembly 
        {   
            let proof_i := add(proof, 0x20)

            mstore(inputs, vk.slot)
            vk_slot_num := keccak256(inputs, 0x20)

            mstore(inputs, mload(add(proof_i, 0x100)))
            mstore(add(inputs, 0x20), mload(add(proof_i, 0x120)))
            mstore(add(inputs, 0x40), sload(add(vk_slot_num, 10)))
            mstore(add(inputs, 0x60), sload(add(vk_slot_num, 11)))

            success := call(gas(), 0x06, 0, inputs, 0x80, add(inputs, 0x240), 0x40)
        }
        require(
            success,
            "bn256Add fail"
        );

        /*
            inputs[0] = proof[0]; //A
            inputs[1] = proof[1];

            inputs[2] = proof[2]; //B
            inputs[3] = proof[3];
            inputs[4] = proof[4];
            inputs[5] = proof[5];

            inputs[6] = vk[0]; //alpha
            inputs[7] = vk[1];

            inputs[8] = vk[2]; //beta
            inputs[9] = vk[3];
            inputs[10] = vk[4];
            inputs[11] = vk[5];

            inputs[12] = proof[6]; //C
            inputs[13] = proof[7];

            inputs[14] = vk[6]; //delta
            inputs[15] = vk[7];
            inputs[16] = vk[8];
            inputs[17] = vk[9];

            inputs[20] = vk[12]; //gamma
            inputs[21] = vk[13];
            inputs[22] = vk[14];
            inputs[23] = vk[15];
        */
        assembly
        {   
            let proof_i := add(proof, 0x20)

            mstore(inputs, mload(proof_i))
            mstore(add(inputs, 0x20), mload(add(proof_i, 0x20)))

            mstore(add(inputs, 0x40), mload(add(proof_i, 0x40)))
            mstore(add(inputs, 0x60), mload(add(proof_i, 0x60)))
            mstore(add(inputs, 0x80), mload(add(proof_i, 0x80)))
            mstore(add(inputs, 0xa0), mload(add(proof_i, 0xa0)))

            mstore(add(inputs, 0xc0), sload(vk_slot_num))
            mstore(add(inputs, 0xe0), sload(add(vk_slot_num, 1)))

            mstore(add(inputs, 0x100), sload(add(vk_slot_num, 2)))
            mstore(add(inputs, 0x120), sload(add(vk_slot_num, 3)))
            mstore(add(inputs, 0x140), sload(add(vk_slot_num, 4)))
            mstore(add(inputs, 0x160), sload(add(vk_slot_num, 5)))

            mstore(add(inputs, 0x180), mload(add(proof_i, 0xc0)))
            mstore(add(inputs, 0x1a0), mload(add(proof_i, 0xe0)))

            mstore(add(inputs, 0x1c0), sload(add(vk_slot_num, 6)))
            mstore(add(inputs, 0x1e0), sload(add(vk_slot_num, 7)))
            mstore(add(inputs, 0x200), sload(add(vk_slot_num, 8)))
            mstore(add(inputs, 0x220), sload(add(vk_slot_num, 9)))

            mstore(add(inputs, 0x280), sload(add(vk_slot_num, 12)))
            mstore(add(inputs, 0x2a0), sload(add(vk_slot_num, 13)))
            mstore(add(inputs, 0x2c0), sload(add(vk_slot_num, 14)))
            mstore(add(inputs, 0x2e0), sload(add(vk_slot_num, 15)))

            success := call(sub(gas(), 2000), 8, 0, inputs, 0x300, inputs, 0x20)
        }

        require(
            success,
            "bn256Pairing fail"
        );

        return inputs[0] != 0;

        // Pairing.G1Point memory A = Pairing.G1Point(proof[0], proof[1]);
        // Pairing.G2Point memory B = Pairing.G2Point(proof[2], proof[3], proof[4], proof[5]);
        // Pairing.G1Point memory C = Pairing.G1Point(proof[6], proof[7]);
        // Pairing.G1Point memory D = Pairing.G1Point(proof[8], proof[9]);

        // Pairing.G1Point memory alpha    = Pairing.G1Point(vk[0], vk[1]);
        // Pairing.G2Point memory beta     = Pairing.G2Point(vk[2], vk[3], vk[4], vk[5]);
        // Pairing.G2Point memory delta    = Pairing.G2Point(vk[6], vk[7], vk[8], vk[9]);
        // Pairing.G1Point memory gamma_abc= Pairing.G1Point(vk[10], vk[11]);
        // Pairing.G2Point memory gamma    = Pairing.G2Point(vk[12], vk[13], vk[14], vk[15]);

        // Pairing.G1Point memory calculated_D = Pairing.add(D, gamma_abc);

        // Pairing.G1Point[] memory G1arr = new Pairing.G1Point[](4);
        // Pairing.G2Point[] memory G2arr = new Pairing.G2Point[](4);

        // G1arr[0] = A;
        // G1arr[1] = alpha;
        // G1arr[2] = C;
        // G1arr[3] = calculated_D;

        // G2arr[0] = B;
        // G2arr[1] = beta;
        // G2arr[2] = delta;
        // G2arr[3] = gamma;

        // return Pairing.pairing(
        //     G1arr, G2arr
        // );

        // return Pairing.pairingProd4(
        //     A,
        //     B,
        //     alpha,
        //     beta,
        //     C,
        //     delta,
        //     calculated_D,
        //     gamma
        // );
        // return true;
    }
}
